    const [allSongs, setAllSongs] = useState([])

    const fetchAllSongs = () => {
        axios.get(`https://localhost3001/songs`).then((response) => {
            console.log(response)
            setAllSongs(response.data)
        })
    }
    useEffect(fetchAllSongs, [])
